import React from "react";
import { Routes, Route } from "react-router-dom";
import MainLayout from "./pages/Layouts/MainLayout.jsx";
import { Homepage } from "./pages/Homepage/homepage.jsx";
import { About } from "./pages/About/about";
import Hotels from "./pages/Hotels/hotels";
import { Restaurants } from "./pages/Restaurants/restaurants.jsx";
import Monuments from "./pages/Monuments/Monuments.jsx";
import "./pages/Homepage/homepage.css";
import "./App.css";
import "./components/Footer/Footer.css";
import "./components/NavBar/navbar.css";
import { Arm } from "./pages/About/about/arm";
import { Qrist } from "./pages/About/about/qrist";
import { Yerevan } from "./pages/About/about/yvn";
import { Arch } from "./pages/About/about/arch";
import { Culture } from "./pages/About/about/culture";
import { Museum } from "./pages/About/about/museum.jsx";
import { Temple } from "./pages/About/about/temple.jsx";
import { Unesco } from "./pages/About/about/unesco.jsx";
import { Cuisine } from "./pages/About/about/cuisine.jsx";
import Register from "./pages/Authorization/Register.jsx";
import Login from "./pages/Authorization/LogIn.jsx";
import HotelDetailPage from "./pages/HotelDetailPage/HotelDetailPage";

const App = () => (
  <>
    <Routes>
      <Route path="/register" element={<Register />} />
      <Route path="/login" element={<Login />} />
      <Route
        path="*"
        element={
          <MainLayout>
            <Routes>
              <Route path="/" element={<Homepage />} />
              <Route path="/about" element={<About />} />
              <Route path="/hotels" element={<Hotels />} />
              <Route path="/restaurants" element={<Restaurants />} />
              <Route path="/monuments" element={<Monuments />} />
              <Route path="/arm" element={<Arm />} />
              <Route path="/qrist" element={<Qrist />} />
              <Route path="/yvn" element={<Yerevan />} />
              <Route path="/arch" element={<Arch />} />
              <Route path="/culture" element={<Culture />} />
              <Route path="/museum" element={<Museum />} />
              <Route path="/temple" element={<Temple />} />
              <Route path="/unesco" element={<Unesco />} />
              <Route path="/cuisine" element={<Cuisine />} />
              <Route path="/hotel/:id" element={<HotelDetailPage />} />
            </Routes>
          </MainLayout>
        }
      />
    </Routes>
  </>
);

export default App;
